class Solution {
public:
    int calPoints(vector<string>& ops) {
        int sum = 0;
        vector<int> scores;
        for (int i = 0; i < ops.size(); i++) {
            if (ops[i] == "C") {
                sum -= scores.back();
                scores.pop_back();
            } else if (ops[i] == "D") {
                scores.push_back(scores.back() * 2);
                sum += scores.back();
            } else if (ops[i] == "+") {
                scores.push_back(scores[scores.size() - 2] + scores.back());
                sum += scores.back();
            } else {
                scores.push_back(stoi(ops[i]));
                sum += scores.back();
            }
        }
        return sum;
    }
};

